var TrspR_def = true;
var TrspR = GM_getValue('TrOpT', TrspR_def);

var Trsplvl_def = 0.1;
var Trsplvl = GM_getValue('TrlvT', Trsplvl_def);

var ImGsFlOv_def = 26;
var ImGsFlOv = GM_getValue('OvFlI', ImGsFlOv_def);

var ScLeP_def = 1;
var ScLeP = GM_getValue('MScls', ScLeP_def);

var NCtTR_def = true;
var NCtTR = GM_getValue('NToCt', NCtTR_def);

var NRiNC_def = true;
var NRiNC = GM_getValue('DRnJC', NRiNC_def);

var spUrI = "<span class=\"LdcnS\" style=\"";

function mscsMain() {
    $('<style type=\"text/css\">body::before{ content: none !important; } body::after{ content: none !important; } .post-image{ position:relative; z-index: 25; } .full-image{ position:relative; z-index: 27; } .LdcnS { position: fixed; background-image: url(\"data:image/png;base64,\\") ;width: 246px; height: 170px; right: 89px; bottom: 23px; transform-origin: 100% 100%; pointer-events: none; animation: Lddance 1s steps(8) infinite; } @keyframes Lddance { 100% { background-position: 0 -1360px; } }</style>').appendTo(document.head);
    $(spUrI+'opacity:1;z-index:-1;"></span>').appendTo(document.body);
    $(spUrI+'opacity:'+Trsplvl+';z-index:'+ImGsFlOv+';"></span>').appendTo(document.body);
    
    !TrspR&&$('.LdcnS:last').css('visibility', 'hidden');
    
    var sCCSS = "div.thread { z-index: 29; } .theme-catalog div.thread{ background: rgb(246, 246, 231) !important; border-color: rgb(200, 200, 190) !important; } .theme-catalog div.thread:hover{ background: #D6DAF0 !important; border-color: #B7C5D9 !important; }";
    $('<style type=\"text/css\" id=\"CtCSS\"></style>').appendTo(document.head);
    
    function stCtCs() {
        $('#CtCSS').html(sCCSS);
    }
    
    function clCtCs() {
        $('#CtCSS').empty();
    }
    
    $('.LdcnS').each(function(){
            $(this).css('transform', 'scale('+ScLeP+')');
    });
    
    NCtTR&&stCtCs();
    
    $('<hr><div>マスコットの設定<button id=\"GMldD\">リセット</button></div><fieldset><legend>透過設定</legend><div><label><input id=\"TrCHb\" type=\"checkbox\"> キャラクターを透過</label></div><div> キャラクターの透過度: <input id=\"TrlSd\" step=\"0.05\" max=\"1\" min=\"0.05\" value=\"0\" style=\"width: 50px;\" type=\"number\"></div><div><label><input id=\"OTCHb\" type=\"checkbox\"> サムネイルの上に表示</label></div><div><label><input id=\"OFCHb\" type=\"checkbox\"> 原寸画像の上に表示</label></div></fieldset><div>キャラクターのサイズ: <input step=\"0.01\" min=\"0.01\" max=\"4\" id=\"SclSd\" value=\"0\" style=\"width: 50px;\" type=\"number\"></div><div><label><input id=\"CTCHb\" type=\"checkbox\"> カタログのタイルを透過しない</label></div><div><label><input id="RnCHb" type="checkbox"> jp.cssが適用されないページでは動作させない(推奨!)</label></div>').appendTo('.options_tab:first');
    
    function initMsTs() {
        $('#TrCHb').prop('checked', TrspR);
        $('#TrlSd').prop('value', Trsplvl);
        $('#TrlSd, #OTCHb, #OFCHb').prop('disabled', !TrspR);
    
        if (ImGsFlOv==28) {
            $('#OTCHb').prop('checked', true);
            $('#OFCHb').prop('checked', true);
        } else if (ImGsFlOv==26) {
            $('#OTCHb').prop('checked', true);
            $('#OFCHb').prop('checked', false);
        } else if (ImGsFlOv==24) {
            $('#OTCHb').prop('checked', false);
            $('#OFCHb').prop('checked', false);
        }
    
        $('#SclSd').prop('value', ScLeP);
        $('#CTCHb').prop('checked', NCtTR);
        $('#RnCHb').prop('checked', NRiNC);
    }
    
    function triggerWarning() {
        $('#TrCHb, #TrlSd, #OTCHb, #OFCHb, #SclSd, #CTCHb, #RnCHb').trigger('change');
    }
    
    initMsTs();
    
    $('#TrCHb').change(function() {
        $('#TrCHb').prop('checked')?$('.LdcnS:last').css('visibility', 'visible'):$('.LdcnS:last').css('visibility', 'hidden');
        TrspR = $('#TrCHb').prop('checked');
        $('#TrlSd, #OTCHb, #OFCHb').prop('disabled', !TrspR);
    
        GM_setValue('TrOpT', TrspR);
    });
    
    $('#TrlSd').change(function() {
        Trsplvl = $('#TrlSd').prop('value');
        $('.LdcnS:last').css('opacity', Trsplvl);
    
        GM_setValue('TrlvT', Trsplvl);
    });
    
    $('#OTCHb, #OFCHb').change(function() {
        $('#OFCHb').prop('disabled', !$('#OTCHb').prop('checked'));
        !$('#OTCHb').prop('checked')&&$('#OFCHb').prop('checked', false);
    
        if ($('#OTCHb').prop('checked') && $('#OFCHb').prop('checked')) {
            ImGsFlOv=28;
        } else if ($('#OTCHb').prop('checked') && !$('#OFCHb').prop('checked')) {
            ImGsFlOv=26;
        } else if (!$('#OTCHb').prop('checked') && !$('#OFCHb').prop('checked')) {
            ImGsFlOv=24;
        }
    
        $('.LdcnS:last').css('z-index', ImGsFlOv);
    
        GM_setValue('OvFlI', ImGsFlOv);
    });
    
    $('#SclSd').change(function() {
        ScLeP = $('#SclSd').prop('value');
        $('.LdcnS').each(function(){
            $(this).css('transform', 'scale('+ScLeP+')');
        });
    
        GM_setValue('MScls', ScLeP);
    });
    
    $('#CTCHb').change(function() {
        $('#CTCHb').prop('checked')?stCtCs():clCtCs();
        NCtTR = $('#CTCHb').prop('checked');
    
        GM_setValue('NToCt', NCtTR);
    });
    
    $('#RnCHb').change(function() {
        NRiNC = $('#RnCHb').prop('checked');
    
        GM_setValue('DRnJC', NRiNC);
    });
    
    $('#GMldD').click(function() {
        if (confirm("ほんとうに消しますか？\n（元にもどせません！）") && confirm("こうかいしませんね？\n（もどせませんよ！）")) {
            TrspR = TrspR_def;
            Trsplvl = Trsplvl_def;
            ImGsFlOv = ImGsFlOv_def;
            ScLeP = ScLeP_def;
            NCtTR = NCtTR_def;
            NRiNC = NRiNC_def;
            GM_setValue('TrOpT', TrspR_def);
            GM_setValue('TrlvT', Trsplvl_def);
            GM_setValue('OvFlI', ImGsFlOv_def);
            GM_setValue('MScls', ScLeP_def);
            GM_setValue('NToCt', NCtTR_def);
            GM_setValue('DRnJC', NRiNC_def);
            initMsTs();
            triggerWarning();
            alert("けしました");
        }
    });
    
    $(window).focus(function() {
        if (TrspR + Trsplvl + ImGsFlOv + ScLeP + NCtTR + NRiNC != GM_getValue('TrOpT', TrspR_def) + GM_getValue('TrlvT', Trsplvl_def)
            + GM_getValue('OvFlI', ImGsFlOv_def) + GM_getValue('MScls', ScLeP_def) + GM_getValue('NToCt', NCtTR_def) + GM_getValue('DRnJC', NRiNC_def)) {
                TrspR = GM_getValue('TrOpT', TrspR_def);
                Trsplvl = GM_getValue('TrlvT', Trsplvl_def);
                ImGsFlOv = GM_getValue('OvFlI', ImGsFlOv_def);
                ScLeP = GM_getValue('MScls', ScLeP_def);
                NCtTR = GM_getValue('NToCt', NCtTR_def);
                NRiNC = GM_getValue('DRnJC', NRiNC_def);
                initMsTs();
                triggerWarning();
        }
    });
}

!NRiNC&&mscsMain();
NRiNC&&$('#stylesheet').attr('href')=="/stylesheets/board/jp.css"&&mscsMain();